    mapping(address => bool) public myAddressMapping;

    function setValue(uint _index) public{
        dinesh[_index] = true;
    }

    function setMyvar1ToTrue() public{
        myvar1 = true;
    }


    function setMyAddressToTrue() public{
        myAddressMapping[msg.sender] = true;
    }
}

